        pageDescription:
          type: text
          locales:
            da-dk: >-
              Udforsk din kuraterede liste over yndlingskaffer, bryggere og
              tilbehør. Nyd de bedste kaffevalg, håndplukket kun til dig hos
              Java Drip Coffee Shop.
            de-at: >-
              Entdecken Sie Ihre kuratierte Liste mit Lieblingskaffees, -brühern
              und -zubehör. Genießen Sie die besten Kaffeeauswahlen, die
              speziell für Sie im Java Drip Coffee Shop zusammengestellt wurden.
            de-ch: >-
              Entdecken Sie Ihre kuratierte Liste Ihrer Lieblingskaffees,
              -brüher und -zubehör. Genießen Sie die besten Kaffeeauswahlen, die
              speziell für Sie im Java Drip Coffee Shop ausgewählt wurden.
            de-de: >-
              Entdecken Sie Ihre kuratierte Liste Ihrer Lieblingskaffees,
              -brüher und -zubehör. Genießen Sie die besten Kaffeeauswahlen, die
              speziell für Sie im Java Drip Coffee Shop ausgewählt wurden.
            en-au: >-
              Explorez votre liste personnalisée de cafés, cafetières et
              accessoires préférés. Profitez des meilleures sélections de café
              soigneusement choisies pour vous au Java Drip Coffee Shop.
            en-ca: >-
              Explore your curated list of favourite coffees, brewers, and
              accessories. Enjoy the best coffee selections handpicked just for
              you at Java Drip Coffee Shop.
            en-gb: >-
              Explore your curated list of favourite coffees, brewers, and
              accessories. Enjoy the best coffee selections handpicked just for
              you at Java Drip Coffee Shop.
            en-nl: >-
              Verken je samengestelde lijst van favoriete koffies,
              koffiezetapparaten en accessoires. Geniet van de beste
              koffieselecties die speciaal voor jou zijn uitgekozen bij Java
              Drip Coffee Shop.
            en-nz: >-
              Entdecken Sie Ihre kuratierte Liste Ihrer Lieblingskaffees,
              -brüher und -zubehör. Genießen Sie die besten Kaffeeauswahlen, die
              speziell für Sie im Java Drip Coffee Shop ausgewählt wurden.
            en-us: >-
              Explore your curated list of favorite coffees, brewers, and
              accessories. Enjoy the best coffee selections handpicked just for
              you at Java Drip Coffee Shop.
            fr-ca: >-
              Explorez votre liste de cafés, cafetières et accessoires préférés
              soigneusement sélectionnés. Profitez des meilleures sélections de
              café choisies spécialement pour vous chez Java Drip Coffee Shop.
            fr-ch: >-
              Explorez votre liste sélectionnée de cafés, cafetières et
              accessoires préférés. Profitez des meilleures sélections de café
              choisies spécialement pour vous chez Java Drip Coffee Shop.
            fr-fr: >-
              Explorez votre liste sélectionnée de cafés, cafetières et
              accessoires préférés. Profitez des meilleures sélections de café
              choisies spécialement pour vous chez Java Drip Coffee Shop.
            ja-jp: >-
              お気に入りのコーヒー、コーヒーメーカー、アクセサリーの厳選リストを探索しましょう。Java Drip Coffee
              Shopで、あなたのために厳選された最高のコーヒーセレクションをお楽しみください。
            nl-nl: >-
              Verken je samengestelde lijst van favoriete koffiesoorten,
              koffiezetapparaten en accessoires. Geniet van de beste koffie
              selecties, speciaal voor jou uitgekozen bij Java Drip Coffee Shop.
            sv-se: >-
              Utforska din noggrant utvalda lista över favoritkaffen, bryggare
              och tillbehör. Njut av de bästa kaffeurvalen handplockade bara för
              dig på Java Drip Coffee Shop.
            ar-uae: >-
              استكشف قائمتك المنسقة من القهوة المفضلة، وأجهزة التحضير،
              والإكسسوارات. استمتع بأفضل اختيارات القهوة المختارة خصيصًا لك في
              مقهى جافا دريب.
